package db.domain;import java.util.Arrays;public class NewEquipmentImpl implements NewEquipment {	@Key	private String uname;	@Key	private int equipmentId;	private int templetId;	private int level;	private int fighterTypeId;	private int price;	public NewEquipmentImpl() {	}	public NewEquipmentImpl(NewEquipment c) {		this.uname = c.getUname();		this.equipmentId = c.getEquipmentId();		this.templetId = c.getTempletId();		this.level = c.getLevel();		this.fighterTypeId = c.getFighterTypeId();		this.price = c.getPrice();	}	@Override	public String tableName() {		return "new_equipment";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setEquipmentId(int equipmentId) {		this.equipmentId = equipmentId;	}	public int getEquipmentId() {		return this.equipmentId;	}public void addEquipmentId(int equipmentId) {		this.equipmentId += equipmentId;}	public void setTempletId(int templetId) {		this.templetId = templetId;	}	public int getTempletId() {		return this.templetId;	}public void addTempletId(int templetId) {		this.templetId += templetId;}	public void setLevel(int level) {		this.level = level;	}	public int getLevel() {		return this.level;	}public void addLevel(int level) {		this.level += level;}	public void setFighterTypeId(int fighterTypeId) {		this.fighterTypeId = fighterTypeId;	}	public int getFighterTypeId() {		return this.fighterTypeId;	}public void addFighterTypeId(int fighterTypeId) {		this.fighterTypeId += fighterTypeId;}	public void setPrice(int price) {		this.price = price;	}	public int getPrice() {		return this.price;	}public void addPrice(int price) {		this.price += price;}}